import styles from "./../assets/pages/Servidor.module.css";

function Servidor(){
    return (
        <div style={{background: "#eee", display: flex, justifyContent: "center", alignItems: "center"}}>
            <div className={styles.containerServidor}>
                <p>Servidor</p>
            </div>
        </div>
    )
}

export default Servidor;
